counter = 0
exports.setup = function() {
    this.input('input');
    this.input('input_fromC3');
    this.input('new_objs');
    this.output('output_main');
    this.output('output_sub');
    this.output('output_toC1');
    this.output('output_toC2');
}
exports.fire = function() {
    var objs = this.get('input');
    if (objs === null) return;

    var new_objs = this.get('new_objs');
    var input_fromC3 = this.get('input_fromC3');

    var ObjectType = Java.type('ptolemy.data.type.ObjectType');
    var objectType = new ObjectType();
    //alert(objs.Contracted_Rental.specializing_Paid_Rental.toString() == "object(null)")
    //alert(objs.Contracted_Rental.specializing_Paid_Rental == objectType)
    if (objs.Contracted_Rental.specializing_Paid_Rental.toString() == "object(null)") {// TODO
    	// TODO
    	new_objs.main.Paid_Rental.ID = counter;
    	new_objs.main.Paid_Rental.specializedFrom_Contracted_Rental = objs.Contracted_Rental.ID;
    	new_objs.main.Paid_Rental.Rental = objs.Contracted_Rental.Rental;
    	new_objs.main.Paid_Rental.rental_amount = 0; //TODO
    	this.send('output_toC2', new_objs.main);
    	objs.Contracted_Rental.specializing_Paid_Rental = new_objs.main.Paid_Rental.ID;
    	this.send('output_toC1', objs);
    	//this.send('output_main');
    	//this.send('output_sub');
    } else {

		var flag_paymentPMed= false;
		for (var i = 0; i < input_fromC3.length; i++){
			if (objs.Contracted_Rental.specializing_Paid_Rental.toString() === input_fromC3[i].Objs.Paid_Rental.ID.toString()){

				if (input_fromC3[i].Intention.toString() === "pm"){
					flag_paymentPMed = true;	
				}
			}
		}

    	if (flag_paymentPMed){
    		this.send('output_main', objs);
    		//this.send('output_sub');
    		//this.send('output_toC1');
    		//this.send('output_toC2');
    	} else {
    		//this.send('output_main');
    		//this.send('output_sub');
    		this.send('output_toC1', objs);
    		//this.send('output_toC2');
    	}
		/*
    	if (input_fromC3 === null) {
    		print(typeof input_fromC3);
    	} else {

    		var array = input_fromC3.getValue();
			print(array);
    	}
    	*/


    }

    counter = counter + 1;
	//this.send('output_main', objs);
	//this.send('output_sub', objs);
}

