var counter = 0;
exports.setup = function() {
    this.input('input');
    this.output('output_init');
    this.output('output');
}
exports.fire = function() {
    var objs = this.get('input');

    objs.init.Rental.ID = counter;
    objs.init.Rental.specializing_Contracted_Rental = counter;
    objs.init.Rental.rental_charge = 5000 ;
    this.send('output_init', objs.init);

    objs.main.Contracted_Rental.ID = counter;
    objs.main.Contracted_Rental.specializedFrom_Rental = objs.init.Rental.ID;
    objs.main.Contracted_Rental.Rental = objs.init.Rental.ID;


	this.send('output', objs.main);

	counter = counter + 1;
}
